<ul>
<li>mentor_profile</li>
<li>partner_admin_profile</li>
<li>district_admin_profile</li>
</ul>

<p>I want to store these as references in a single key in a user schema defined like so...I didn't want to make them all separate keys because if I need to populate them I feel like I would do unnecessary logic that I can avoid if I just define them in a single key.</p>

<pre><code>const mongoose = require("mongoose");
const Schema = mongoose.Schema;

// Create Schema
const UserSchema = new Schema({
  name: {
    type: String,
    required: true,
  },
profile:{
type: Schema.Types.ObjectId,
    ref: "partner_admin_profile", &lt;--- Is it possible to store profiles to this dynamically?

}
  date: {
    type: Date,
    default: Date.now,
  },
});

module.exports = User = mongoose.model("users", UserSchema);
</code></pre>

