MongoDB - filter condition and 3-deep objects<p>I need to get all the docs where <code>translations.proposedTranslation</code> exists, but <code>translations.proposedTranslation.translator</code> doesn't, in at least one of the objects in the <code>translations</code> array.</p>

<p>These docs <strong>should</strong> be selected:</p>

<pre><code>{
    translations: [{
        language: "spanish",
        proposedTranslation: {
            user: "123456789"
        }
    }]
}
//and
{
    translations: [{
        language: "spanish",
        proposedTranslation: {
            user: "123456789"
        }
    }, {
        language: "french",
        proposedTranslation: {
            user: "123456789",
            translator: "987654321"
        }
    }]
}
</code></pre>

<p>This one should <strong>not</strong>:</p>

<pre><code>{
    translations: [{
        language: "spanish",
        proposedTranslation: {
            user: "123456789",
            translator: "987654321"
        }
    }]
}
</code></pre>

<p>Here's what I have so far:</p>

<pre><code>$expr: {
    $gte: [
        {
            $size: {
                $filter: {
                    input: "$translations",
                    cond: {
                        $and: [
                            {
                                $ne: ["$$this.proposedTranslation", null]
                            },
                            {
                                $eq: ["$$this.proposedTranslation.translator", null]
                            }
                        ]
                    }
                }
            }
        },
        1
    ]
}
</code></pre>

<p>However, this returns no docs. I think it's because of <code>$eq: ["$$this.proposedTranslation.translator", null]</code>, since it works as it should if I omit that line. Is there something I need to change since it's a 3-deep object?</p>

