Lookup only if foreign field is not null in mongoDB<p>I have collections for articles and comments. Comment may have <code>articleId</code> (it is answer to article) or <code>parentId</code> (it is answer to another comment). There are only 2 levels, answer to another comment cannot have answer.</p>

<pre><code>// articles
{ "_id": 100, "text": "Article text" } 

// comments
{ "_id": 1, "text": "First text", "articleId": 100 },
{ "_id": 2: "text": "Second text", "articleId": 100 },
{ "_id": 3, "text": "Third text", "parentId": 2 }  
</code></pre>

<p>I would like find all <strong>articles</strong>, <strong>comments</strong> of articles and <strong>answers</strong> to comments.</p>

<pre><code>db.getCollection("articles").aggregate([
    { "$match": {} },

    // Lookup comments of article.
    { "$lookup": { "from": "comments", "localField": "_id", "foreignField": "parentId", as: "comments" } },
    { "$unwind": { "path": "$comments", "preserveNullAndEmptyArrays": true } },

    // Lookup answers to comments. There I need lookup only when foreignField is not null.
    { "$lookup": { "from": "comments", "localField": "comments._id", "foreignField": "parentId", "as": "comments.answers" } },
    { "$group": { "_id": "$_id", "comments": { "$push": "$comments" }, "text": { "first": "$text" } }
])
</code></pre>

<p>It works if the article has some comments. But if not, after first <code>lookup</code> (comments of article) article looks like this (empty array is ok):</p>

<pre><code>{ "_id": 100, "text": "Article text", "comments": [] }
</code></pre>

<p>And after second <code>lookup</code> (answers to comments):</p>

<pre><code>{
    "_id": 100,
    "text": "Article text",
    "comments": [{
        "answers": [
            { "_id": 1, "text": "First text", "articleId": 100 },
            { "_id": 2: "text": "Second text", "articleId": 100 }
        ]
    }]
}
</code></pre>

<p>Even if there are no comments, there are some answers to comments. I think it is because localField <code>comments._id</code> is <code>null</code> and foreignField <code>parentId</code> of these answers is also <code>null</code>. Is there any way to lookup only when foreignField is <code>not null</code>? </p>

