Nestjs MongoDb Schema/Interface Information Duplication<p>I have been following the <a href="https://docs.nestjs.com/techniques/mongodb" rel="nofollow noreferrer">instructions</a> for using MongoDb with Nestjs. I've got things working however it seems to me there is a rather unnecessary duplication of information (not DRY). Specifically it seems that we are required to make Db schema and also interfaces that match the schema. In my own code this looks something like this:</p>

<pre class="lang-js prettyprint-override"><code>import { Document, Schema } from 'mongoose';

export interface IBlogPost extends Document {
  subject: string;
  body: string;
  authorId: string;
}

export const BlogPostSchema = new Schema({
  subject: String,
  body: String,
  authorId: String,
});
</code></pre>

<p>The rest of my code is in <a href="https://github.com/Peter554/nest-auth-starter" rel="nofollow noreferrer">this repo</a> if you want more context. The official example code is <a href="https://github.com/nestjs/nest/tree/master/sample/14-mongoose-base" rel="nofollow noreferrer">here</a>.</p>

<p>Am I doing something wrong or is this really required?</p>

